int ctm_glx_key_repr(char *dst,int dsta,int src) {
  if (!dst) dsta=0;
  if ((src>=0x61)&&(src<=0x7a)) { if (dsta>=1) dst[0]=src; if (dsta>1) dst[1]=0; return 1; }
  int lo=0,hi=sizeof(ctm_glx_valuesym)/sizeof(struct ctm_glx_valuesym);
  while (lo<hi) {
    int ck=(lo+hi)>>1;
         if (src<ctm_glx_valuesym[ck].keysym) hi=ck;
    else if (src>ctm_glx_valuesym[ck].keysym) lo=ck+1;
    else {
      const char *src=ctm_glx_text+ctm_glx_namesym[ctm_glx_valuesym[ck].nameix].p;
      int srcc=ctm_glx_namesym[ctm_glx_valuesym[ck].nameix].c;
      if (srcc<=dsta) {
        memcpy(dst,src,srcc);
        if (srcc<dsta) dst[srcc]=0;
      }
      return srcc;
    }
  }
  return -1;
}

int ctm_glx_key_eval(int *dst,const char *src,int srcc) {
  if (!dst||!src) return -1;
  if (srcc<0) { srcc=0; while (src[srcc]) srcc++; }
  if (!srcc) return -1;
  if (srcc>17) return -1;
  char lower[17];
  int i; for (i=0;i<srcc;i++) if ((src[i]>=0x41)&&(src[i]<=0x5a)) lower[i]=src[i]+0x20; else lower[i]=src[i];
  int lo=0,hi=sizeof(ctm_glx_namesym)/sizeof(struct ctm_glx_namesym);
  while (lo<hi) {
    int ck=(lo+hi)>>1;
         if (srcc>ctm_glx_namesym[ck].c) hi=ck;
    else if (srcc<ctm_glx_namesym[ck].c) lo=ck+1;
    else {
      int cmp=memcmp(lower,ctm_glx_text+ctm_glx_namesym[ck].p,srcc);
           if (cmp<0) hi=ck;
      else if (cmp>0) lo=ck+1;
      else { *dst=ctm_glx_namesym[ck].keysym; return 0; }
    }
  }
  return -1;
}

int ctm_glx_key_to_unicode(int keysym) {
  if ((keysym>=0x01000000)&&(keysym<0x01110000)) return keysym-0x01000000;
  if ((keysym>=0x20)&&(keysym<=0x7f)) return keysym;
  int lo=0,hi=sizeof(ctm_glx_valuesym)/sizeof(struct ctm_glx_valuesym);
  while (lo<hi) {
    int ck=(lo+hi)>>1;
         if (keysym<ctm_glx_valuesym[ck].keysym) hi=ck;
    else if (keysym>ctm_glx_valuesym[ck].keysym) lo=ck+1;
    else return ctm_glx_valuesym[ck].unicode;
  }
  return 0;
}
